import { useState } from 'react';
import { createCalculator } from '../api';

function Admin() {
  const [name, setName] = useState('');
  const [type, setType] = useState('');
  const [defaultRate, setDefaultRate] = useState('');
  const [fields, setFields] = useState([{ label: '', type: '' }]);
  const [description, setDescription] = useState('');
  const [message, setMessage] = useState('');

  const handleAddField = () => {
    setFields([...fields, { label: '', type: '' }]);
  };

  const handleFieldChange = (index, e) => {
    const newFields = [...fields];
    newFields[index][e.target.name] = e.target.value;
    setFields(newFields);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    const newCalculator = {
      name,
      type,
      description,
      defaultRate: parseFloat(defaultRate),
      fields: fields.map(field => ({ label: field.label, type: field.type }))
    };

    try {
      await createCalculator(newCalculator);
      setMessage('Калькулятор успешно добавлен!');
    } catch (error) {
      setMessage('Ошибка при добавлении калькулятора.');
    }
  };

  return (
    <div>
      <h2>Админ-панель</h2>
      <p>Управление калькуляторами.</p>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Название калькулятора:</label>
          <input 
            type="text" 
            value={name} 
            onChange={(e) => setName(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Тип калькулятора:</label>
          <input 
            type="text" 
            value={type} 
            onChange={(e) => setType(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Ставка по умолчанию:</label>
          <input 
            type="number" 
            value={defaultRate} 
            onChange={(e) => setDefaultRate(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Описание калькулятора:</label>
          <textarea 
            value={description} 
            onChange={(e) => setDescription(e.target.value)} 
            required 
          />
        </div>
        
        <h3>Поля калькулятора</h3>
        {fields.map((field, index) => (
          <div key={index}>
            <label>Название поля:</label>
            <input
              type="text"
              name="label"
              value={field.label}
              onChange={(e) => handleFieldChange(index, e)}
              required
            />
            <label>Тип поля:</label>
            <input
              type="text"
              name="type"
              value={field.type}
              onChange={(e) => handleFieldChange(index, e)}
              required
            />
            <button
              type="button"
              onClick={() => {
                const newFields = fields.filter((_, idx) => idx !== index);
                setFields(newFields);
              }}
            >
              Удалить поле
            </button>
          </div>
        ))}
        <button type="button" onClick={handleAddField}>Добавить поле</button>
        <button type="submit">Добавить калькулятор</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
}

export default Admin;
